import { useState } from "react";
import "./App.css";
import records from "./records.json";

function App() {
  const [count, setCount] = useState(0);

  return (
    <div className="App">
      <h1>Count: {count}</h1>
      <button onClick={() => setCount(count + 1)}>+</button>
      <button onClick={() => setCount(count - 1)}>-</button>
      {
        records.map( record => {
          return(
            <div className="box" key={record.id}>
              {record.name}
              {}
            </div>
          )
        })
      }
    </div>
  );
}

export default App;
